//Cards.js

import React from 'react';
import { data } from '../data';
import '../App.css';

const Cards = () => {
  return (
    <div className='card'>

		<section className='column-left'>
          <img className="card-img" src={details.coverImg} alt={details.title} />
		</section>

		<section className='column-right'>
		<span className='material-symbols-outlined'>location_on </span>
		<span className="card-country">{details.country} </span>
 				<a href={details.googleMapLink}>View on Google Maps</a>
 				<h3 className="card-country-title">{details.title}</h3>
 				<p className='para'>{details.description}</p>
 				<span>Read more..</span>
		</section>
    </div>
  );
};

export default Cards;

